A thief and killer stalks the streets of Paris, leaving a calling card from &quot;Monsieur Durand&quot; at the scene of each crime. But after a cache of these macabre identifications is discovered by a burglar in the boarding house at 21 Avenue Junot, Inspector Wenceslas Vorobechik (Pierre Fresnay) takes lodging at the infamous address in an undercover bid to solve the crime, with help from his struggling - actress girlfriend Mila (Suzy Delair).

Featuring audacious directorial touches, brilliant performances, and a daring tone that runs the gamut from light comedy to sinister noir, as well as a subtle portrait of tensions under Nazi occupation, this overlooked gem from the golden age of French cinema is presented in a beautiful new high - definition restoration.  

